window.bookSummaryJSON = "<p>Transporting goods is part of the job, but when Keystone accepts the daunting task of moving precious cargo, the team splits up. Raven has orders to follow, but Christian's seductive ways draw out her violent soul. Their journey is dangerous, their enemies ruthless, and one misstep could prove fatal. </p> <p>When one team member mysteriously vanishes, the rest must choose between cutting their losses in the face of chaos or seeing it through to the bitter end. Will Keystone have the fortitude to complete the mission, or will they fall like dominoes? </p> <p>Evil forces are at play in this spellbinding continuation of the Crossbreed series.</p>"; 
